Thanks for your answer.

I want to make something like

``` java
SharedPreferences prefs = PreferenceManager.getDefaultPreferences(this);
Editor edit = prefs.edit();
edit.putString("synopsis", synopsis);
edit.commit();
```

in the tag method for example.

I understand the choice I have for doing that. And yes, the easiest is certainly to reuse the constructed Book object with a post-process (option 1). But I would like to not have to create this Book object to execute my method. And create a static method into my Book class (option 2) is also too much Book-dependent.

That's why I think the option 3 is certainly the best solution. I just didn't get how you obtain the constructed value with the Factory class. I don't see what the Factory look like, could you clarify a little bit this point please ?

I know that what I want to do is quite complex, so thanks a lot for your answers and your time. I will wait for your response when you will have the time for that, have a good day !

Something like this might do it:

```
Factory<Book, Void> factory = new Factory<Book,Void>(){
    public Void newTarget(Book aBook) {
        SharedPreferences prefs = PreferenceManager.getDefaultPreferences(this);
        Editor edit = prefs.edit();
        edit.putString("synopsis", synopsis);
        edit.commit();
        return null;
    }
}

reader = mappingOf("books", Books.class, factory).to(
    tag("book", Book.class).with(
        tag("title"),
            tag("synopsis")
        )
    );
```

I used Void and returned null just to show that it doesn't have to be the same type. It would probably be better to use `Factory<Book, Book>` and return the aBook parameter just to avoid the possibility of NPE's.

One thing that concerns me though ... are you marshalling _any_ objects from this XML, or you want to perform actions like the above on all branches of the XML tree?

I ask because DSL4XML is a marshalling tool - designed to produce Java object graphs as a result of parsing - but the kind of thing you're trying to do (perform actions when XML tags are encountered) sounds like a good fit for event-based XML parsing - (ie. SAX, using a ContentHandler). If you don't want the marshalled objects, working directly with SAX will be faster (at runtime) and will generate less garbage.
